values:
That was literally the best concert I have ever been to.&nbsp;Idina&nbsp;is freaking awesome! She sang two songs from Wicked and No Day But Today from Rent! It was so fabulous, And then Mary and I waited outside for like, an hour and&nbsp;a half after the concert in the hopes of getting pics, autographs etc. And she came out and did some but the rude ass people who are like RABID Idina fans completely ignored her security guys who were telling us to get in a line and all rushed in a big group to the front&nbsp;and THEY all got pics and sigs and we got&nbsp;nothing. I almost&nbsp;kicked someone's ass, and&nbsp;I'm pretty&nbsp;much passive-agressive.&nbsp;But I did get to touch her shoulder and I was almost face to face with her. She is&nbsp;so gorgeous in person. :) :) :)&nbsp;

And more good news! We got our test results back on Corey's lil&nbsp;"guys" and there is nothing wrong with him! We can conceive naturally! Well,&nbsp;we're stilll doing the IVF but we dont need a donor! :) :) :) :)

What a great few days. :)&nbsp;

Totally&nbsp;by accident dyed my hair purple today. I bought this color that was called Chocolate Cherry, which is supposed to be&nbsp;like&nbsp;a deep brown with a reddish tinge to it. I think I may have either put too much on, left it on too long or both because my hair is now&nbsp;a purpley-black. :) I freaked at first. Then Corey came home and said he adored it, which Nat said&nbsp;he would, since she is all-knowing and wise. :) :) :) :)&nbsp;So yey. I have purpley hair. It's so cool. I cant stop looking at it.&nbsp;

Last&nbsp;night, I had the weirdest&nbsp;dreams. What is with my dreams lately?? I had&nbsp;3&nbsp;dreams in a row last week that my mom had bought me a Coach purse (which is like, huh?!), then I&nbsp;keep having dreams that I'm being captured or held. And now last night, I dream about my worst nightmare happening again, the dreaded R-word (which is a bad word, we dont say that word) and who is there to comfort me&nbsp;when in my dream I am having (weirdly enough) flashbacks? My ex. NOT, as you would probably assume, the ex I ran into the other day&nbsp;for the first time in 6 years since last he suddenly disappeared on me. My other ex that I recently reconciled with (yey!). My subconcious is either doped up or trying to tell me something deep that I just dont understand.&nbsp;

My hubby is out working on a job right now, yes&nbsp;at 1230 in the morning, so I am going to make a valiant attempt to go to bed, although it&nbsp;probably wont happen as&nbsp;the second I lay down and start to relax, I will no doubt hear burglars and start to freak out, per usual. So I'll just end up watching TV&nbsp;til he's&nbsp;home. :) &nbsp;
